void ssd1306_Scroll(){
uint32_t start = HAL_GetTick();
uint32_t end = start;
int fps = 0;
char message[] = "EMERGANCY      DETECTED      ";

ssd1306_SetCursor(28,0);
ssd1306_WriteString("Warning", Font_11x18, Black);
ssd1306_SetCursor(2, 18*2);
ssd1306_WriteString("Be careful", Font_11x18, Black);

do {
    ssd1306_SetCursor(2, 18);
    ssd1306_WriteString(message, Font_16x15, Black);
    ssd1306_UpdateScreen();

    char ch = message[0];
    memmove(message, message+1, sizeof(message)-2);
    message[sizeof(message)-2] = ch;

    fps++;
    end = HAL_GetTick();
} while((end - start) < 5000);
}

